sys_variable_value.value:
(function execute(inputs, outputs) {

  var obj = {
    "long_url" : inputs.long_url,
    "domain" : inputs.domain,
    "group_guid" : ""
  };

  if (inputs.group_guid) {
    obj.group_guid = inputs.group_guid;
  }

  outputs.full_shorten = obj;

})(inputs, outputs);

